import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import axios from 'axios';
import '../styles/routineTemplates.css';

export default function TherapistPatientTemplatesDetail() {
  const { patientId } = useParams();
  const [patient, setPatient]     = useState(null);
  const [instances, setInstances] = useState([]);
  const [loading, setLoading]     = useState(true);
  const [error, setError]         = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const token = localStorage.getItem('token');
      try {
        // 1) Get patient info (from your therapist/patients endpoint)
        const { data: patients } = await axios.get('/api/therapist/patients', {
          headers: { 'x-auth-token': token }
        });
        const pat = patients.find(p => p._id === patientId);
        setPatient(pat);

        // 2) Get all routine instances for that patient
        const { data: inst } = await axios.get(
          `/api/routines/instances/${patientId}`,
          { headers: { 'x-auth-token': token } }
        );
        setInstances(inst);
      } catch (err) {
        setError(err.response?.data?.msg || 'Error cargando datos');
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, [patientId]);

  if (loading) return <p>Cargando datos…</p>;
  if (error)   return <p className="error-msg">{error}</p>;
  if (!patient) return <p className="error-msg">Paciente no encontrado.</p>;

  return (
    <div className="tpl-container patient-detail-page">
      <div className="detail-header">
        <Link to="/therapist/templates" className="back-link">
          ← Volver
        </Link>
        <h1>Plantillas de {patient.nombre} {patient.apellidos}</h1>
      </div>

      {instances.length === 0 ? (
        <p>No hay plantillas asignadas a este paciente.</p>
      ) : (
        instances.map(inst => {
          const tpl   = inst.template;
          const total = tpl.activities.length;
          const done  = inst.completedActivities.length;
          const pct   = Math.round((done/total)*100);

          return (
            <div key={inst._id} className="tpl-card">
              {/* Header: name + % badge */}
              <div style={{ display:'flex',justifyContent:'space-between',alignItems:'center' }}>
                <h2>{tpl.name}</h2>
                <span className="tag-badge">{pct}% Completado</span>
              </div>

              {/* Progress bar */}
              <div className="progress-bar">
                <div
                  className="progress-filled"
                  style={{ width: `${pct}%` }}
                  aria-label={`${pct}% completado`}
                />
              </div>
              <p className="progress-text">
                {done} de {total} actividades ({pct}%)
              </p>

              {/* Tags */}
              <div className="tags-container">
                {tpl.tags?.map(tag => (
                  <span key={tag} className="tag-badge">{tag}</span>
                ))}
              </div>

              {/* Metadata */}
              <div className="tpl-meta detail-meta">
                <div><i className="fa fa-calendar"></i> Asignado: {new Date(inst.createdAt).toLocaleDateString()}</div>
                <div><i className="fa fa-refresh"></i> Última actualización: {new Date(inst.updatedAt || inst.createdAt).toLocaleString()}</div>
                <div><i className="fa fa-clock-o"></i> Duración: {tpl.duration} min</div>
                <div><i className="fa fa-flag"></i> Actividades: {total}</div>
              </div>

              {/* Description */}
              {tpl.description && (
                <section className="tpl-section">
                  <h3 className="section-title">Descripción</h3>
                  <p>{tpl.description}</p>
                </section>
              )}

              {/* Detailed Activities */}
              <section className="tpl-section">
                <h3 className="section-title">Actividades</h3>
                <ul className="activities-detailed-list">
                  {tpl.activities.map((act, idx) => {
                    const completed = inst.completedActivities.includes(idx);
                    return (
                      <li
                        key={idx}
                        className={`activity-detail-item ${completed ? 'completed' : ''}`}
                      >
                        <div className="activity-main">
                          <label className="checkbox-label">
                            <input
                              type="checkbox"
                              checked={completed}
                              disabled
                            />
                            <span className="activity-name">{act.name}</span>
                          </label>
                          <div className="activity-info-icons">
                            <span title="Duración"><i className="fa fa-clock-o"></i> {act.minutes} min</span>
                            <span title="Nivel de reto"><i className="fa fa-star"></i> {act.challenge}</span>
                          </div>
                        </div>
                        {act.desc && (
                          <p className="activity-desc">{act.desc}</p>
                        )}
                      </li>
                    );
                  })}
                </ul>
              </section>
            </div>
          );
        })
      )}
    </div>
  );
}
